    false,nt"url": null,nt"notes": " The Battlespace Acoustics Laboratory Complex
    at Wright-Patterson Air Force, Ohio seeks to revolutionize auditory displays and
    communication systems to maximize operator effectiveness in complex acoustic environments.
    Unique, world-class laboratories containing highly-specialized, state-of-the-art
    equipment are employed in research focused on the basic and applied aspects of auditory
    and speech perception, communications, hearing protection, and in the development
    and optimization of advanced auditory and multisensory displays for information
    portrayal in support of the needs of the warfighter.  ",nt"license_title":
